const newsId2 = '<h1 style="text-align: start;"><span style="color: rgb(245, 245, 245);">爆火的Sora，对医疗领域会有哪些影响？</span></h1><p><br></p><p><span style="color: rgb(217, 217, 217); font-size: 15px;">北京时间2月16日凌晨，OpenAI宣布了一项重大突破：其全新研发的文生视频大模型Sora正式亮相。继文字、图片之后，全世界再一次被OpenAI震撼了。几乎没有AI制作痕迹的流畅视频，让社交媒体惊呼：现实，是不是不存在了？</span></p><p style="text-align: center;"><img src="data:image/png;base64," alt="image.png" data-href="" style=""></p><p><span style="color: rgb(217, 217, 217); font-size: 15px;">这款具有60秒超长时长、1080P高质量视频，能在单一视频中实现多角度镜头切换、内嵌世界模型的视频模型Sora，又将如何影响医疗行业？</span></p><p style="text-align: center;"><span style="color: rgb(217, 217, 217);"><strong>开启机遇之门</strong></span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>1. 医疗教育的革新：</strong></span><span style="color: rgb(217, 217, 217);">Sora有能力制作出栩栩如生的手术过程视频，为医学生和医疗专业人员提供了一个既安全又可控的学习复杂手术技巧的环境。这种将互动性与真实性融为一体的教学方式，预示着医疗教育将迈入一个新的纪元。Sora的视频不仅具有动态的相机运动和三维空间的连贯性，还能创造出更加生动和互动的学习材料，助力学生深入理解复杂的医学概念和手术技巧。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>2. 市场营销的革新：</strong></span><span style="color: rgb(217, 217, 217);">对于医疗器械制造商来说，Sora开辟了产品演示和市场营销的新途径。企业可以利用Sora制作详尽的产品使用视频，生动展示设备的特性、操作流程及其潜在的治疗效果，以极其逼真的方式向潜在客户彰显产品的独特优势。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>3. 患者教育的革新：</strong></span><span style="color: rgb(217, 217, 217);">Sora能够生成充满细节的场景和情感丰富的角色视频，成为医患沟通的强大工具，有助于解释复杂的医疗程序或手术风险。这种富含情感的表现形式能更有效地帮助患者理解他们的治疗选择，减轻他们的焦虑。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>4. 远程患教与病例讨论的革新：</strong></span><span style="color: rgb(217, 217, 217);">Sora的视频内容使得医生能够远程向患者清晰地解释复杂的医疗程序，提高患者的理解度和满意度，使医疗服务更加个性化和高效。Sora对复杂场景和角色表情的精确捕捉，加之其实现复杂镜头运动和长期连续性的能力，为医疗器械的使用和医疗程序的展示提供了全新的视角。例如，在展示设备使用过程中，可以全面呈现设备与患者的互动，包括操作者的表情和动作反应，从而提供更全面的使用场景理解。"</span></p><p style="text-align: center;"><span style="color: rgb(217, 217, 217);"><strong>新兴职业机遇</strong></span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>1. 医疗可视化设计师：</strong></span><span style="color: rgb(217, 217, 217);">利用Sora等工具创造高质量的医疗教育和培训视频，这些设计师需要具备医疗知识和艺术设计能力，以确保视频内容既准确又易于理解。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>2. 医疗多媒体内容编辑：</strong></span><span style="color: rgb(217, 217, 217);">负责编辑和审校通过Sora生成的视频内容，确保其医学准确性、教育价值和合规性，同时也涉及版权和伦理标准的考虑。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>3. AI伦理和合规专家：</strong></span><span style="color: rgb(217, 217, 217);">确保Sora及其应用程序遵守医疗伦理原则和隐私法规。这包括监控AI生成内容的准确性和适当性，避免误导信息和确保患者信息的保密性。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>4. 医疗培训和教育顾问：</strong></span><span style="color: rgb(217, 217, 217);">专门使用Sora创建的视频和模拟工具来设计和实施医疗教育和培训项目。这些顾问将帮助医疗机构和专业人员充分利用新技术进行学习和发展。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>5. 研究和发展（R&amp;D）人员：</strong></span><span style="color: rgb(217, 217, 217);">使用Sora等技术进行产品演示、原型设计和测试。这些人员将探索如何将AI视频生成技术集成到产品开发和市场营销策略中。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>6. 远程医疗顾问：</strong></span><span style="color: rgb(217, 217, 217);">利用Sora生成的视频内容提供远程医疗咨询和支持，帮助解释复杂的医疗程序和设备使用方法，改善患者体验和满意度。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>7. 数据科学家和分析师：</strong></span><span style="color: rgb(217, 217, 217);">分析Sora生成的视频数据和用户互动，以提高内容质量、用户参与度和教育效果。这些角色将关注于从视频内容中提取洞察和改进点。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);">随着Sora及类似技术的进一步发展和应用，预计还会出现更多与AI视频生成、医疗数据处理和用户体验优化相关的工作机会。这些新兴职位将要求跨学科的知识和技能，包括医学、计算机科学、数据分析、用户体验设计和伦理法律知识。</span></p><p style="text-align: center;"><span style="color: rgb(217, 217, 217);"><strong>Sora+医疗 &nbsp;还有哪些可能性？</strong></span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);">有人将Sora称为人工智能创新的下一个前沿阵地，有国外的医疗行业人士认为，Sora在医疗保健和临床试验中具有多种潜在应用，例如：</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>1. 提升患者参与和依从性：</strong></span><span style="color: rgb(217, 217, 217);">可以利用Sora为试验中的患者生成定制视频，为他们解释具体的治疗方案、用药计划，展示预期副作用，从而改善文字繁多的现状，提升沟通效率。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>2. 心理健康治疗：</strong></span><span style="color: rgb(217, 217, 217);">可以制作个性化的视频用于治疗目的，例如引导图像、减压技术或创伤后应激障碍等条件下的暴露治疗场景。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>3. 模拟手术过程：</strong></span><span style="color: rgb(217, 217, 217);">Sora可以生成详细的手术视频，为医生在实际操作复杂手术前提供练习和可视化场景。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>4. 应急培训：</strong></span><span style="color: rgb(217, 217, 217);">也可利用Sora模拟各种紧急医疗场景，帮助医疗专业人员和急救人员做好应对各种情况的准备。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"><strong>5. 实现无障碍增强：</strong></span><span style="color: rgb(217, 217, 217);">对于有残疾或语言障碍的患者，Sora 可以生成带有手语、字幕或不同语言的定制视频，以确保所有病人都能获得可理解的健康信息。</span></p><p style="text-align: center;"><span style="color: rgb(217, 217, 217);"><strong>AI并非万能，医学不仅仅是数据</strong></span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);">人工智能在医疗领域，特别是医学影像方面已经取得了显著成就。根据央视新闻联播报道，目前，美国FDA已批准约420种涉及成像的算法，主要用于癌症治疗。这些算法的准确率可达80%至90%。工业和信息化部赛迪研究院数据显示，2023年，我国生成式人工智能的市场规模约为14.4万亿元。</span><span style="color: rgb(217, 217, 217);"><strong>制造业、零售业、电信行业和医疗健康等四大行业的生成式人工智能技术的采用率均取得较快增长。</strong></span><span style="color: rgb(217, 217, 217);">专家预测，</span><span style="color: rgb(217, 217, 217);"><strong>2035年生成式人工智能有望为全球贡献近90万亿元的经济价值，其中我国将突破30万亿元</strong></span><span style="color: rgb(217, 217, 217);">，占比超过四成。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);">场景应用、商业化快速发展，与此同时，关于医疗健康领域人工智能应用的伦理风险讨论也越来越深入，并已形成了一部分规范、指南。不论是文字、影像或是其他形式，人工智能参与科学研究、临床活动，影响医疗决策，就意味着它会直接影响生命健康，需谨慎评估其风险。</span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);"></span></p><p style="text-align: justify;"><span style="color: rgb(217, 217, 217);">以色列医疗保健组织Maccabi Healthcare Services研究与创新中心的负责人Dr. Tal Patalon近日在福布斯网站发文谈及Sora的发布。她表示，</span><span style="color: rgb(217, 217, 217);"><strong>“行医是一门艺术，许多经验丰富的临床医生都认同这一基本观点。我们的诊断和治疗是由我们的经验、观点和创造力推动的，而不仅仅是纯粹的临床数据。”</strong></span><span style="color: rgb(217, 217, 217);"> 同时她也提到，变革是不可避免的，算法在医疗诊断和治疗建议方面展现出越来越强的能力，并慢慢融入实践。针对Sora的发布，她认为，</span><span style="color: rgb(217, 217, 217);"><strong>尽管前景广阔，但人工智能在艺术表达中失去个性和情感的问题正在引起人们的关注</strong></span><span style="color: rgb(217, 217, 217);">，在医学领域也是如此。</span></p>'


